import "./chart.css";
import { LineChart,
         Line,
         XAxis,       
         CartesianGrid,
         Tooltip,
         Legend,
         ResponsiveContainer } from 'recharts';

export default function Chart() {
    const data = [
        {
            name: 'JAN',
            "월별 방문자수": 1000        
        },
        {
            name: 'Feb',
            "월별 방문자수": 2000        
        },
        {
            name: 'Mar',
            "월별 방문자수": 3000        
        },
        {
            name: 'Apr',
            "월별 방문자수": 4000        
        },
        {
            name: 'May',
            "월별 방문자수": 2000        
        },
        {
            name: 'Jun',
            "월별 방문자수": 1000        
        },
        {
            name: 'Jul',
            "월별 방문자수": 4000        
        },
        {
            name: 'Agu',
            "월별 방문자수": 2000        
        },
        {
            name: 'Sep',
            "월별 방문자수": 3000        
        },
        {
            name: 'Oct',
            "월별 방문자수": 4000        
        },
        {
            name: 'Nov',
            "월별 방문자수": 1000        
        }, 
        {    
            name: "Dec",
            "월별 방문자수": 4000        
        }       
      ];

    return (
        <div className="chart">
            <h3 className="chartTitle">Sales Analytics</h3>
            <ResponsiveContainer width="100%" aspect={4 / 1}>
                <LineChart data={data}>
                    <XAxis dataKey="name" stroke="#5550bd"/>
                    <Line type="monotone" dataKey="월별 방문자수" stroke="#5550bd" />
                    <Tooltip />
                    <CartesianGrid stroke="#e0dfdf" strokeDasharray="5 5" />
                    <Legend />
                </LineChart>
            </ResponsiveContainer> 
        </div>
    )
}
